        function toggleWordlist() {
            var $wordlist = document.getElementById("wordlist");
            $wordlist.style.display = $wordlist.style.display == "none" ? "block" : "none"
        }

        var timeleft = -1;
        var wordWasGuessed = false;

        function pickRandomWord() {
            var $wordlist = document.getElementById("wordlist");
            var $word = document.getElementById("word");
            var words = wordlist.value.trim().split("\n");
            var wordIndex = Math.round(Math.random() * (words.length-1));
            var word = words[wordIndex];
            console.log(words.length + " - " + wordIndex)
            $word.innerText = word;
            timeleft = -1;
            wordWasGuessed = false;
        }


        function startGuessing() {
            var totalSeconds = document.getElementById("seconds").value;
            timeleft = totalSeconds;
            var $timer = document.getElementById("timer");
            $timer.innerText = timeleft + " / " + totalSeconds + " seconds left";

            var downloadTimer = setInterval(function () {
                $timer.innerText = timeleft + " / " + totalSeconds + " seconds left";
                if (timeleft % 1 == 0) {
                    _beep.play();
                }
                if (timeleft <= 0 || wordWasGuessed) {
                    clearInterval(downloadTimer);
                    if (wordWasGuessed) {
                        $timer.innerText = "Guessed in " + (totalSeconds - timeleft) + " seconds";
                        _tada.play();
                    } else {
                        _sadTrombone.play();
                        $timer.innerText = "Word was not guessed!";
                    }
                    timeleft = -1;
                    wordWasGuessed = false;
                }
                timeleft--;
            }, 1000);
        }

        function wordGuessed() {
            wordWasGuessed = true;
        }
